import styled from "styled-components";
import { Facebook, Instagram, Twitter } from "@material-ui/icons";

const Container = styled.div`
  display: flex;
`;
const Left = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  padding: 20px;
`;

const Logo = styled.h1``;
const Desc = styled.h1`
  margin: 20px 0px;
`;
const SocialContainer = styled.h1`
  display: flex;
  justify-content: space-between;
  width: 25%;
`;
const SocialIcon = styled.div`
  width: 40px;
  height: 40px;
  border-radius: 50%;
  color: white;
  background-color: ${(props) => props.color};
  display: flex;
  align-items: center;
  justify-content: center;
`;

const Center = styled.div`
  flex: 1;
  padding: 20px;
`;
const Right = styled.div`
  flex: 1;
  padding: 20px;
`;

const Footer = () => {
  return (
    <Container>
      <Left>
        <Logo>Phalnax</Logo>
        <Desc>
          We frimly Believe that Style and Elegance should go hand in hand, And
          We work to make that happen, In the most simple and profound way
          possible
        </Desc>
        <SocialContainer>
          <SocialIcon color="#339af0">
            <Facebook />
          </SocialIcon>
          <SocialIcon color="#fd7e14">
            <Instagram />
          </SocialIcon>
          <SocialIcon color="#228be6">
            <Twitter />
          </SocialIcon>
        </SocialContainer>
      </Left>
      <Center></Center>
      <Right></Right>
    </Container>
  );
};

export default Footer;
